import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./Home";
import ReservationForm from "./RsrvForm";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/reservation" element={<ReservationForm />} />
      </Routes>
    </Router>
  );
}

export default App;
